import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const myelement = (
  <table>
    <tr>
      <th>Name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
    <tr>
      <td>Elsa</td>
    </tr>
  </table>
);
class Car extends React.Component {
  render() {
    return <h2>Hi, I am a Car!</h2>;
  }
}

const myElement2 = <h1>React is {5 + 5} times better with JSX</h1>;
const root = ReactDOM.createRoot(document.getElementById('root'));
const myElement4 = <input type="text" />;
const x = 5;
let text = "Goodbye";
if (x < 10) {
  text = "Hello";
}

function Garage() {
  return (
    <>
      <h1>Who lives in my Garage?</h1>
      <Car />
    </>
  );
}

class Bus extends React.Component {
  constructor() {
    super();
    this.state = {color: "red"};
  }
    changeColor = () => {
    this.setState({color: "blue"});
  }
  render() {
    return (
      <div>
        <h1>My {this.state.brand}</h1>
        <p>
          It is a {this.state.color}
          {this.state.model}
          from {this.state.year}.
        </p>
        <button
          type="button"
          onClick={this.changeColor}
        >Change color</button>
      </div>
    );
  }
}


class Taxi extends React.Component {
  render() {
    return <h2>I am a Taxi!</h2>;
  }
}

class Garage_for extends React.Component {
  render() {
    return (
      <div>
      <h1>Who lives in my Garage?</h1>
      <Taxi />
      </div>
    );
  }
}
root.render(<Garage />)
const myElement6 = <h1>{(x) < 10 ? "Hello" : "Goodbye"}</h1>;
const myElement5 = <h1>{text}</h1>;
const myElement3 = (
  <ul>
    <li>Apples</li>
    <li>Bananas</li>
    <li>Cherries</li>

  </ul>
);
root.render(
  <React.StrictMode>
    <App />
    {myelement}
    {myElement2}
    {myElement3}
    {myElement4}
    {myElement5}
    {myElement6}
    <Car color="red"/>
    <Car color="blue"/>
    <Car color="blue"/>
    <Bus />
    <Garage_for />



  </React.StrictMode>
);

reportWebVitals();
